    var nameString = ' ' + food.name
    console.log(nameString.length)
    var dotss = [' ']
        for(var i = 0 ; i < 138 - nameString.length ; i ++){
            dotss.push('   .   ')
        }
    
    return(
        <div className="container">
            <div className = "food">
            <h3>
                {food.name}
                {dotss}
                {food.price}
            </h3>
            <h3>
                {food.description}
            </h3>
        </div>
        <button class="btn" type="submit">Add</button>
        </div>
        
        
    )
}

export default Food2
